// import {Link} from 'react-router-dom';

function HomeData() {
    useEffect( () => {
        fetchItems();
    }, []);

    const [items, setItems] = useState([]);

    const fetchItems = async () => {
        const data = await fetch('/BackendData');
        const items = await data.json();
        setItems(items);
    };

    return(
        <section>
            Hi
        </section>
    );
}

export default HomeData;
